webpackJsonp([0x8f0ce58d3892],{1098:function(A,e){A.exports={pathContext:{group:[{node:{id:"d9001ef3-3bdd-49a0-9890-0807cfb21655",title:"Coyote Defense League Pale Ale",link:null,body:{value:"<p>First brew in collaboration with one of my neighbors. It came out pretty well. We got the water ratio wrong so it was a little thin, but the color and general flavor profile was pretty solid.</p>\r\n<p>Most importantly, we came up with a bunch of elaborate names. We're calling our pretend brewery 'Antcolony Brewing' - a stretch, but this is a combination of two of our kids names - Anthony and Colin (get it?) The beer itself is called 'Coyote Defense League Pale Ale' due to the surprising Coyote problem we've had in the neighborhood this year.</p>\r\n<p>Looking forward to another brew soon. Looking like something dark next time around.</p>"},relationships:{image:{localFile:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:.75,src:"/static/02bf366e30f2109414c6479968f41c8f-7b4969a8fff234546240e67cf2ba667f-42807.jpg",srcSet:"/static/02bf366e30f2109414c6479968f41c8f-7b4969a8fff234546240e67cf2ba667f-960f9.jpg 313w,\n/static/02bf366e30f2109414c6479968f41c8f-7b4969a8fff234546240e67cf2ba667f-c36f2.jpg 625w,\n/static/02bf366e30f2109414c6479968f41c8f-7b4969a8fff234546240e67cf2ba667f-42807.jpg 1250w,\n/static/02bf366e30f2109414c6479968f41c8f-7b4969a8fff234546240e67cf2ba667f-9f2a8.jpg 1500w",sizes:"(max-width: 1250px) 100vw, 1250px"}}}}},fields:{slug:"/note/coyote-defense-league-pale-ale/"},post_type:"note",created:1539705836}},{node:{id:"49e2c13b-76d9-430f-a2fe-258110ee54bf",title:"Learning How to Adapt - Developing Up",link:"http://www.developingup.com/36",body:{value:'<p>Enjoyed listening back to this chat about adapting as a developer that I had with <a href="https://twitter.com/mikemiles86">Mike Miles</a> for his <a href="http://www.developingup.com/">Developing Up podcast</a>. We end up pretty far away from some of the traditional dev topics you might expect, but I think that is the improviser in me applying  \'yes, and...\' to our conversation. Mike does a great job reinforcing how some of my more tangential thoughts relate back to adaptability. Not to mention some great editing - you can hardly tell that we were talking at the end of a long day at a conference.</p>'},relationships:{image:null},fields:{slug:"/link/learning-how-to-adapt-developing-up/"},post_type:"link",created:1536711066}},{node:{id:"54297a75-ed2a-4ccf-9dd8-521cd8cf5ec4",title:"In The Garage: Joyce Manor Share The Scenes And Stories Behind Million Dollars To Kill Me",link:"https://www.stereogum.com/featured/joyce-manor-million-dollars-to-kill-me-interview/",body:{value:"<blockquote>This January, they’re co-headlining the 3,700-cap Hollywood Palladium with Jeff Rosenstock, who they consider a fellow “last man standing” in their scene and the man responsible for Joyce Manor’s first paid gig in 2010. “As we were leaving, he asked ‘You guys get paid?'” Johnson recalls. “We’re like, it’s cool, we’re from around here, it’s fine. And he’s like no, no, no,” handing the band $100 out of his pocket.</blockquote>\r\n<p>Great profile in general, but this moment between two of my favorite bands stuck with me. Amazing to see Rosenstock give them what I'd imagine to be a non-trivial amount of money at the time just because he feels strongly that people should be compensated for their work. And I love that this impulsive moment also sticks with Joyce Manor eight years later as co-headliners. While I've never just handed someone $100, I can only hope that back in my improv days or now in the open source community I've had some small moments that have stuck with folks.</p>"},relationships:{image:null},fields:{slug:"/link/in-the-garage:-joyce-manor-share-the-scenes-and-stories-behind-million-dollars-to-kill-me/"},post_type:"link",created:1535467148}},{node:{id:"eed54d1f-bf9b-4a04-b414-fbe15c2f2eb3",title:"Beach",link:null,body:{value:"<p>Current status: enjoying the beach.</p>"},relationships:{image:{localFile:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:.75,src:"/static/c7cc440b25aa9410cbe0c89c2e216e7a-91a9fec28a8e410705dfe91ad323482a-42807.jpg",srcSet:"/static/c7cc440b25aa9410cbe0c89c2e216e7a-91a9fec28a8e410705dfe91ad323482a-960f9.jpg 313w,\n/static/c7cc440b25aa9410cbe0c89c2e216e7a-91a9fec28a8e410705dfe91ad323482a-c36f2.jpg 625w,\n/static/c7cc440b25aa9410cbe0c89c2e216e7a-91a9fec28a8e410705dfe91ad323482a-42807.jpg 1250w,\n/static/c7cc440b25aa9410cbe0c89c2e216e7a-91a9fec28a8e410705dfe91ad323482a-dbc5e.jpg 1875w,\n/static/c7cc440b25aa9410cbe0c89c2e216e7a-91a9fec28a8e410705dfe91ad323482a-6e234.jpg 2500w,\n/static/c7cc440b25aa9410cbe0c89c2e216e7a-91a9fec28a8e410705dfe91ad323482a-a7d90.jpg 3024w",sizes:"(max-width: 1250px) 100vw, 1250px"}}}}},fields:{slug:"/note/beach/"},post_type:"note",created:1532612422}},{node:{id:"67f05c4a-1d8a-4bbc-bd3d-ad3b8c0f45aa",title:"The Design Tool Dilemma - freeCodeCamp",link:"https://medium.freecodecamp.org/the-design-tool-dilemma-225541c4ad1d",body:{value:"<p>Found this article especially relevant as I'm currently following just behind our UX team prototyping in code as they design early mockups using InVision. The spirit of what we're doing is aiming for the \"collaborative\" narrative outlined in this post, but the fact that there is still a handoff occasionally makes it feel like what the article calls “bridging the gap.” It is very early days, but I'm anxious for a future where more of our tools can speak the same language and actually impact code that will be used in the final project. Still a long way to go on that front though.</p>\r\n<p>I found this embedded quote to be especially insightful:</p>\r\n<blockquote>\r\nProduction code is a surrogate for decision-making power. Production code is the source of truth. It is the realtime sum total of all the conversations, all the decisions, all the politics…it is everything. Whoever is pushing code to production is running the product. Everyone else only has influence.\r\n<cite><a href=\"http://www.artypapers.com/ap.log/thread.php?346\">Rebekah Cox</a></cite>\r\n </blockquote>\r\n<p>I don't necessarily want all of that power. In a perfect world, I help enable others to assert control on the areas of the project where they are experts. With our current tools there is just too much risk of things being lost in translation. Today we're doing the best we can with the tools we have and against all odds we often find a way to make it work.</p>"},relationships:{image:null},fields:{slug:"/link/the-design-tool-dilemma-freecodecamp/"},post_type:"link",created:1532035775}}],pathPrefix:"",first:!1,last:!1,index:2,pageCount:11,additionalContext:{}}}}});
